int group_num = 0;  //number of group in disjoint set
int max_group_size = 0;

typedef struct dset{
    int size;
    int parent;
} dset;
dset ds[600];

void dset_init(dset *ds){
    for(int i=0; i<600; i++){
        ds[i].parent = -1;
        ds[i].size = 0;
    }
    group_num = 0;
    max_group_size = 0;
}

void make_set(int i){
    ds[i].parent = i;
    ds[i].size = 1;
}

int get_root(int i){
    int i0 = i;
	//path compression
    while(ds[i].parent != i)
		i = ds[i].parent;
		
	int temp;
	while(i0 != i){
		temp = ds[i0].parent;
		ds[i0].parent = i;
		i0 = temp;
	}
    
	return i;
}

int find_set(int id){
    if(ds[id].size == 0) make_set(id);

    return get_root(id);
}

void Union(int id1, int id2){
    id1 = find_set(id1);
    id2 = find_set(id2);
    
    if(id1 != id2)
	{
		if(ds[id1].size > 1 && ds[id2].size > 1)
			group_num--;
		else if(ds[id1].size == 1 && ds[id2].size == 1)
			group_num++;
		
		if(ds[id1].size >= ds[id2].size){
	    	ds[id2].parent = id1;
	    	ds[id1].size += ds[id2].size;
	    	
	    	if(ds[id1].size > max_group_size)
	    		max_group_size = ds[id1].size;
		}
		else{
			ds[id1].parent = id2;
	    	ds[id2].size += ds[id1].size;
	    	
	    	if(ds[id2].size > max_group_size)
	    		max_group_size = ds[id2].size;
		}
	}
}


// The testdata only contains the first 100 mails (mail1 ~ mail100)
// and 2000 queries for you to debug.

int n_mails, n_queries;
mail *mails;
query *queries;

int main(){
	api.init(&n_mails, &n_queries, &mails, &queries);
    int len = 1;

	mail *t_mail;
	int n;
	int *ids;
	int ans[2];

	for(int i = 0; i < n_queries; i++){
        if(queries[i].type == group_analyse){
            n = queries[i].data.group_analyse_data.len;
            ids = queries[i].data.group_analyse_data.mids;
            dset_init(ds);

            for(int j=0; j<n; j++){
                Union(name_hash[ids[j]][0], name_hash[ids[j]][1]);
            }
            ans[0] = group_num;
            ans[1] = max_group_size;
            api.answer(i, ans, 2);
        }
    }
    
    return 0;
}
